      that affects the proper  disclosure of payments against debt when those payments
      require memo entries on Schedule B or H4. The Co mm  tee is working with the
      software vendor to resolve this issue. Memo #2: Schedule A contributions from
      Donald  Malarkey shows a year-to-date total of $20,100, when, in fact the total
      is $10,100 due to a redesignation to a  non-federal account. This is another
